body,html{
    position: absolute;
    margin: 0;
    padding: 0;
    top: 0;
    right: 0;
    left: 0;
    bottom: 0;
    overflow: hidden;
    background: 0 0;

    touch-action: none;
}

canvas {
    position: fixed;
    top: 0;
    left: 0;
}

#ui {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: 99;
}


.screen {
    width: 100%;
    height: 100%;
    position: absolute;
    top: 0;
    left: 0;
}

.cover {
    background: rgba(0, 0, 0, 0.5);
}

.center-absolute {
    position: absolute;
    left: 0;
    right: 0;
    bottom: 0;
    top: 0;
    margin: auto;
}


.not-select{
    -moz-user-select: none;
    -webkit-user-select: none;
    user-select: none;
}

.hide {
    visibility: hidden;
    opacity: 0;
    transition: opacity 1s, visiblility 1s;
}

.show {
    visibility: visible;
    opacity: 1;
    transition: opacity 1s, visiblility 1s;
}

.simple-pulse{
    animation-name: pulse;
    animation-duration: 0.5s;
    animation-iteration-count: infinite;
    animation-direction: alternate;
}

#animation_container {
	position:absolute;
	margin:auto;
	left:0;right:0;
	top:0;bottom:0;
}


@keyframes alpha {
    0% {
        opacity: 1;
    }

    100% {
        opacity: 0;
    }
}

.rail-hand{
    position: absolute;
    width:120px;
    height:120px;

    animation-name: pulse;
    animation-duration: 0.5s;
    animation-iteration-count: infinite;
    animation-direction: alternate;
}

.rail-hand img{
    transform: rotate(-10deg);
    max-width: 100%;
    max-height: 100%;
}

.low-fuel{
    position: absolute;
    transform-origin: top left;

    animation-name: alpha;
    animation-duration: 0.5s;
    animation-iteration-count: infinite;
    animation-direction: alternate;
}


.info-text{
    position: absolute;
    text-align: center;
    font-size: 40px;
    font-family: ui-font;
    width:100%;

    color: #d1445e;

    animation-name: pulse;
    animation-duration: 0.15s;
    animation-iteration-count: infinite;
    animation-direction: alternate;

}

.circle-bar{
    position: absolute;
    left: 100px;

    height: 150px;

}

    var h = window.innerHeight;
    var dimensions;
    if (window.dapi && window.dapi.getScreenSize) {
      dimensions = window.dapi.getScreenSize();

            for (const node of m.removedNodes) {
              if (node.id === "preloader") {
                return node;
              }

          })();

          if (preloaderDiv) {

            disconnectObservers();

      }
